import React from 'react';
import Card from './Card';

const CardList = ({ robots, robot }) => {
	const CardComponent = robots.map((robot, i) => {
		return <Card id={robots[i].id} name={robots[i].name} email={robots[i].email} />
	})
	return (
		<div key={ robot.id }>
			{ CardComponent }								
		</div>
		);
}

export default CardList;
